	public static int lengthOfLongestSubstring2(String s) {
		int n = s.length(), ans = 0;

		// HashMap is used to store the character set.
		Map<Character, Integer> charMap = new HashMap<>();
		// i stores the value of the Sliding Window
		// j stores the value of the current Index

		for (int i = 0, j = 0; j < s.length(); j++) {
			char charAtJ = s.charAt(j);
			// i will be Max of Character If it is found and itself
			// Max(foundIndex, i)

			// Includes the Found Index since, we are looking at abcdc, the next
			// string has to be d,

			if (charMap.containsKey(charAtJ)) {
				i = Math.max(charMap.get(charAtJ) + 1, i);
			}

			// Best answer will be the Max(j-i+1, ans)
			ans = Math.max(ans, j - i + 1);

			// Put the Value with the latest index back into the Map
			charMap.put(charAtJ, j);
		}
		return ans;
	}

	public static int lengthOfLongestSubstring(String s) {
		System.out.println(lengthOfLongestSubstringMine(s) + ":"
				+ lengthOfLongestSubstring2(s) + ":" + s);

		return lengthOfLongestSubstring2(s);
	}

	public static int lengthOfLongestSubstringMine(String s) {

		// Remove Spaces
		s = s.trim();
		// Max Set
		// Stores Location and the Character
		Map<Character, Integer> maxMap = new HashMap<>(s.length());

		int lengthOfLongestSubString = 0;
		int bestKnownIndex = 0;
		int i = 0;
		for (; i < s.length();) {
			char nextChar = s.charAt(i);
			Integer locationOfChar = maxMap.get(nextChar);
			// Get Location of Char
			// If Location is > bestKnownIndex
			if (locationOfChar != null && locationOfChar >= bestKnownIndex) {
				// Current SubString - what is the current SubString we are
				// dealing with
				// dvdf when we reach 'd', the subStringSize should be 2 i.e 2-0
				// cdd when we reach 2nd 'd', the subStringSize should be 2-0
				// i.e 2
				// abcabc
				int subStringSize = i - bestKnownIndex;
				lengthOfLongestSubString = lengthOfLongestSubString > subStringSize ? lengthOfLongestSubString
						: subStringSize;
				// Update the Best Known Index to the CurrentLocation of
				// Character
				bestKnownIndex = locationOfChar + 1;
			}
			// Update the Location of the Character with the new Location
			maxMap.put(nextChar, i++);
		}
		int subStringSize = i - bestKnownIndex;
		lengthOfLongestSubString = lengthOfLongestSubString > subStringSize ? lengthOfLongestSubString
				: subStringSize;

		// System.out.println("Length of Longest:" + lengthOfLongestSubString);
		return lengthOfLongestSubString;
	}

